import React from "react";
import {
    Text,
    View,
  } from 'react-native';
import Post from './listing';
const fakePost = [1,2,3];

function Listing() {
    return (
      <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
        <Text>Listing!</Text>
        {fakePost.map()}
      </View>
    );

  }


  export default Listing;
